const slove_Sequence ={
    SequenceExpression(path){
        // 处理 ax = (a=123,b=3,4) -> a=123;b=3;ax=4
        let {parentPath,node,scope} = path
        if(!parentPath.isAssignmentExpression()){
            return;
        }

        let WrongPath = path.findParent(p=>p.isConditionalExpression()) || path.findParent(p=>p.isLogicalExpression());
        if(WrongPath){
            // console.log(path.toString());
            return;
        }

        let {left,operator,right} = parentPath.node;
        if(!types.isIdentifier(left) || !types.isSequenceExpression(right) || operator != '='){
            return;
        }
        
        let{extra,expressions} = node;
        if(!extra.parenthesized || expressions.length <= 0){
            return;
        }

        let lastExpression = expressions.pop();
        for(let expression of expressions){
            parentPath.insertBefore(types.ExpressionStatement(expression));
        }
        path.replaceWith(lastExpression)
    },
}
traverse(ast,slove_Sequence);


